(async function(Scratch) {
    const blocks = [];

    if (!Scratch.extensions.unsandboxed) {
        alert("This extension needs to be unsandboxed to run!")
        return
    }

    class Extension {
        getInfo() {
            return {
                "blockIconURI": "data:image/jpeg;base64,",
                "id": "multicraft",
                "name": "MultiCraft Servers",
                "color1": "#0088ff",
                "color2": "#0063ba",
                "tbShow": true,
                "blocks": blocks,
                "menus": {
                    serversList: {
                        items: ["1", "2"]
                    },
                    serverInfos: {
                        items: ["address:port", "name", "description"]
                    },
                    serverInfoBools: {
                        items: ["creative mode?", "is damage allowed?", "pvp is allowed?", "password is needed?", "dedicated server?", "rollback enabled?"]
                    },
                    serverTechInfo: {
                        items: ["version", "mapgen", "name of game", "server id", "server location", "ip"]
                    },
                    serverPlayersInfo: {
                        items: ["total players", "connected players", "max players", "total existed players"]
                    },
                }
            }
        }
    }
    function httpGet(theUrl, returnResponse) {
        let xmlHttp = new XMLHttpRequest();
        xmlHttp.open("GET", theUrl, false);
        xmlHttp.send(null);
        if (returnResponse == true) {
            return xmlHttp
        } else {
            if (xmlHttp.status == 200) {
                return xmlHttp.responseText
            } else {
                throw new Error(xmlHttp.status);
            }
        }
    };
    function getMultiCraftServersList() {
        return JSON.parse(httpGet("https://api.codetabs.com/v1/proxy/?quest=https://servers.multicraft.world/list.json"));
    };
    function createBlock(type, id, text, argument, func) {
        blocks.push({
            opcode: id,
            blockType: type,
            text: text,
            arguments: argument,
            disableMonitor: true,
            isEdgeActivated: false
        });
        Extension.prototype[id] = func;
    };
    function createLabel(text) {
        blocks.push({
            blockType: Scratch.BlockType.LABEL,
            text: text
        });
    };

    createLabel("General info of server");
    createBlock(Scratch.BlockType.REPORTER, "multicraft_getInfo", "get [info] about server [server]", {
        info:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serverInfos",
        },
        server:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serversList",
        }
    }, async (args) => {
        let data = getMultiCraftServersList()["list"];
        let server = Number(args["server"])-1;
        let info = args["info"];
        if (info == "address:port") {
            return data[server]["address"]+":"+data[server]["port"]
        } else {
            return data[server][info]
        }
    });
    createLabel("Players count");
    createBlock(Scratch.BlockType.REPORTER, "multicraft_getPlayersInfo", "fetch [info] of server [server]", {
        info:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serverPlayersInfo",
        },
        server:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serversList",
        }
    }, async (args) => {
        let data = getMultiCraftServersList()["list"];
        let server = Number(args["server"])-1;
        let info = args["info"];
        if (info == "total players") {
            return data[server]["clients"]
        } else if (info == "max players") {
            return data[server]["clients_max"]
        } else if (info == "connected players") {
            return JSON.stringify(data[server]["clients_list"])
        } else if (info == "total existed players") {
            return data[server]["total_clients"]
        }
    });
    createLabel("Server settings");
    createBlock(Scratch.BlockType.BOOLEAN, "multicraft_getSetting", "get server setting [info] of server [server]", {
        info:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serverInfoBools",
        },
        server:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serversList",
        }
    }, async (args) => {
        let data = getMultiCraftServersList()["list"];
        let server = Number(args["server"])-1;
        let info = args["info"];
        if (info == "is damage allowed?") {
            return data[server]["damage"]
        } else if (info == "creative mode?") {
            return data[server]["creative"]
        } else if (info == "password is needed?") {
            return data[server]["password"]
        } else if (info == "rollback enabled?") {
            return data[server]["rollback"]
        } else if (info == "pvp is allowed?") {
            return data[server]["pvp"]
        } else if (info == "dedicated server?") {
            return data[server]["dedicated"]
        }
    });
    createBlock(Scratch.BlockType.REPORTER, "multicraft_getTechInfo", "get technical [info] of server [server]", {
        info:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serverTechInfo",
        },
        server:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "serversList",
        }
    }, async (args) => {
        let data = getMultiCraftServersList()["list"];
        let server = Number(args["server"])-1;
        let info = args["info"];
        if (info == "server location") {
            return data[server]["geo_continent"]
        } else if (info == "name of game") {
            return data[server]["gameid"]
        } else {
            return data[server][info.replace(/ /g, "_")]
        }
    });

    Scratch.extensions.register(new Extension());
})(Scratch);
